// src/pages/Overview.jsx
import React from 'react';
import './Overview.css';
import Projects from '../components/Projects';
import DataSources from '../components/DataSources';
import Panels from '../components/Panels';
import Dashboards from '../components/Dashboards';

const Overview = () => {
  return (
    <div className="overview-container">
      <h1>Proyectos</h1>
      <div className="overview-grid">
        <Projects />
        <div className="project-info">
          <h3>Título del proyecto: AGUA POTABLE Y SANEAMIENTO BÁSICO</h3>
          <p>Descripción: No registra</p>
          <p>Fecha de creación: 22 de septiembre de 2023</p>
          <p>Última modificación: No registra</p>
          <p>Autor: adminAguaMinvivienda</p>
          <p>Grupo: AguaMinvivienda</p>
        </div>
      </div>

      <h2>Resumen del proyecto</h2>
      <div className="overview-grid">
        <DataSources />
        <Panels />
        <Dashboards />
      </div>
    </div>
  );
};

export default Overview;
